import logo from '../Assets/img/logo.png';

function Navbar() {
  return (
    <div className="navbar">
      
        <span className="navtext">LUCAS</span>
        <span className="navtext">RESULTADOS</span>
        <span className="navtext">PREGUNTAS FRECUENTES</span>
      

      <div className="nav-center">
        <img src={logo} className="imglogo" alt="logo" />
      </div>
    </div>
  );
}
export default Navbar;
